import classes from "./PlayerItem.module.css";

const PlayerItem = (props) => {
  return (
    <div className={classes.players}>
      <h2>{props.name}</h2>
      <div>
        (Position: {props.position}) 
        (Rank: {props.rank}) 
        (Win rate: {props.winRate})
      </div>
    </div>
  );
};

export default PlayerItem;
